(function () {
  "use strict";

  let ongoingUploads = 0;
  let completedDownloads = 0;
  const soundBase64 =
    "data:audio/mp3;base64,"; // Replace with your Base64 string
  const notificationSound = new Audio(soundBase64);

  let lastCompletedCount = 0;

  function updateCounts() {
    const downloadRows = document.querySelectorAll(".min-h-8");
    let currentCompletedCount = 0;
    ongoingUploads = 0;

    downloadRows.forEach((row) => {
      const copyLink = row.querySelector(".link.cursor-pointer");
      const greenBackground = row.querySelector(".bg-green-800");

      if (
        copyLink &&
        greenBackground &&
        (copyLink.textContent.trim() === "Copy Link" ||
          copyLink.textContent.trim() === "Copied!")
      ) {
        currentCompletedCount++;
      } else {
        ongoingUploads++;
      }
    });

    if (currentCompletedCount > lastCompletedCount) {
      playNotificationSound();
    }

    completedDownloads = currentCompletedCount;
    lastCompletedCount = currentCompletedCount;

    updateTabTitle();
  }

  function updateTabTitle() {
    const originalTitle = document.title.split(" - ")[1] || document.title;
    const totalUploads = completedDownloads + ongoingUploads;
    const uploadStatus = ongoingUploads > 0 ? "⌛" : "✔️";
    document.title = `(${completedDownloads}/${totalUploads}${uploadStatus}) - ${originalTitle}`;
  }

  function playNotificationSound() {
    notificationSound.play();

    document.body.style.transition = "background-color 0.5s";
    document.body.style.backgroundColor = "#FF0000";
    setTimeout(() => {
      document.body.style.backgroundColor = "";
    }, 500);
  }

  window.addEventListener("beforeunload", function (e) {
    if (ongoingUploads > 0) {
      const message =
        "You have ongoing uploads. Are you sure you want to leave?";
      e.returnValue = message;
      return message;
    }
  });

  const style = document.createElement("style");
  style.type = "text/css";
  style.innerHTML = `
        .max-h-40 {
            max-height: none !important;
        }
    `;
  document.head.appendChild(style);

  function findTargetNode() {
    const nodes = document.querySelectorAll(".flex.flex-col.overflow-auto");
    for (let node of nodes) {
      if (node.querySelector(".min-h-8")) {
        return node;
      }
    }
    return null;
  }

  function initObserver() {
    const targetNode = findTargetNode();
    if (targetNode) {
      const observer = new MutationObserver((mutations) => {
        const oldCompletedCount = completedDownloads;
        updateCounts();
        // Only play sound if the number of completed downloads has increased
        if (completedDownloads > oldCompletedCount) {
          playNotificationSound();
        }
      });
      const config = {
        childList: true,
        subtree: true,
        attributes: true,
        attributeFilter: ["style"],
      };
      observer.observe(targetNode, config);
      updateCounts(); // Initial update
    } else {
      setTimeout(initObserver, 1000); // Retry after 1 second if the target node is not found
    }
  }

  // Start observing when the DOM is ready
  if (document.readyState === "loading") {
    document.addEventListener("DOMContentLoaded", initObserver);
  } else {
    initObserver();
  }
})();
